text:
Americans don’t want bureaucrats sitting in on their doctor’s appointments, and they don’t want them to determine their treatment plans. Burdensome regulations keeping patients from accessing life-saving treatment, like colonoscopies, is not only inconvenient but life-threatening. 

Read more about the Reducing Medically Unnecessary Delays in Care Act that I introduced alongside @RepGregMurphy and @RepKimSchrier from @AshleighFields_ at @theHill.

@RepJohnJoyce @RepMcCormick @RepAndyHarrisMD, @timburchett @RepBrianBabin @RepMMM @RepMikeKennedy
